import "./App.css";
import { useState, useEffect } from "react";

function App() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");

  useEffect(() => {
    sessionStorage.setItem("email", email);
  }, [email]);

  function handleChangeName(e) {
    setName(e.target.value);
  }
  function handleChangeEmail(e) {
    setEmail(e.target.value);
  }

  function handleSubmit(e) {
    e.preventDefault();
    console.log("Name:", name);
    setName("");
    setEmail("");
    console.log("email:", email);
  }

  return (
    <div className="App">
      <div className="container">
        <h1>Connect with Us</h1>
        <p>
          We love to respond to your queries and help you succeed. <br />
          Feel free to get in touch with us.
        </p>
        <div className="contact-box">
          <div className="contact-left">
            <h3>Send your Request</h3>
            <form onSubmit={handleSubmit}>
              <div className="input-row">
                <div className="input-group">
                  <label>Name</label>
                  <input
                    type="text"
                    value={name}
                    onChange={handleChangeName}
                    placeholder="John Prank"
                  />
                </div>
                <div className="input-group">
                  <label>Phone</label>
                  <input type="text" placeholder="+233 554694601" />
                </div>
              </div>
              <div className="input-row">
                <div className="input-group">
                  <label>Email</label>
                  <input
                    type="text"
                    value={email}
                    onChange={handleChangeEmail}
                    placeholder="johnprank@gmail.com"
                  />
                </div>
                <div className="input-group">
                  <label>Subject</label>
                  <input type="text" placeholder="Product demo" />
                </div>
              </div>
              <label>Message</label>
              <textarea rows="5" placeholder="your message"></textarea>
              <button type="submit">SEnd</button>
            </form>
          </div>
          <div className="contact-right">
            <h3>Reach Us</h3>
            <table>
              <tbody>
                <tr>
                  <td>Email</td>
                  <td>Contactus@gmail.com</td>
                </tr>
                <tr>
                  <td>Phone</td>
                  <td>+233 54694601</td>
                </tr>
                <tr>
                  <td>Address</td>
                  <td>Accra, Burma Camp</td>
                </tr>
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
